),(12,'sfdsf','<p contenteditable=\"true\">sdfdsfdf</p>','2018-03-23 16:14:48','admin','004','10011','2018-03-23 16:14:48',NULL,'I','2'),(14,'奥术大师多撒奥术大师多阿达','<p contenteditable=\"true\">撒大声地</p><p contenteditable=\"true\">阿萨德sd撒的</p><p contenteditable=\"true\">撒的撒</p><p contenteditable=\"true\"><br></p>','2018-03-23 20:38:16','admin','004','10013','2018-03-23 20:38:16','2018-03-25 13:01:07','U','1'),(15,'撒大声地所多','<p contenteditable=\"true\">1、单行写一个评级组件\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">“★★★★★☆☆☆☆☆”.slice(5 – rate, 10 – rate);定义一个变量rate是1到5的值，然后执行上面代码，看图\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">才发现插件什么的都弱爆了\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">2、如何装逼用代码骂别人SB\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">(!(~+[])+{})[--[~+\"\"][+[]]*[~+[]] + ~~!+[]]+({}+[])[[~!+[]]*~+[]]\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">3、如何用代码优雅的证明自己NB\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">这个牛逼了\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">console.log(([][[]]+[])[+!![]]+([]+{})[!+[]+!![]])\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">4、JavaScript 错误处理的方式的正确姿势\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">，舅服你\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">try {something} catch (e) {window.location.href =\"http://stackoverflow.com/search?q=[js]+\" +e.message;}\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">5、从一行代码里面学点JavaScript\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">[].forEach.call($$(\"*\"),function(a){a.style.outline=\"1px solid #\"+(~~(Math.random()*(1&lt;&lt;24))).toString(16)})\r</p><p contenteditable=\"true\">翻译成正常语言就是这样的\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">Array.prototype.forEach.call(document.querySelectorAll(\'*\'), dom =&gt; dom.style.outline = `1px solid #${parseInt(Math.random() * Math.pow(2,24)).toString(16)}`)\r</p><p contenteditable=\"true\">接下来在浏览器控制看看：something magic happens\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">6、论如何优雅的取随机字符串\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">Math.random().toString(16).substring(2) Math.random().toString(36).substring(2)\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">7、(10)[“toString”]() === “10”\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">8、匿名函数自执行\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">这么多写法你选择哪一种？我选择死亡。\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">( function() {}() );( function() {} )();[ function() {}() ];~ function() {}();! function() {}();+ function() {}();- function() {}();delete function() {}();typeof function() {}();void function() {}();new function() {}();new function() {};var f = function() {}();1, function() {}();1 ^ function() {}();1 &gt; function() {}();// ...\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">9、另外一种undefined\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">从来不需要声明一个变量的值是undefined，因为JavaScript会自动把一个未赋值的变量置为undefined。所有如果你在代码里这么写，会被鄙视的\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">var data = undefined;\r</p><p contenteditable=\"true\">但是如果你就是强迫症发作，一定要再声明一个暂时没有值的变量的时候赋上一个undefined。那你可以考虑这么做：\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">var data = void 0; // undefined\r</p><p contenteditable=\"true\">void在JavaScript中是一个操作符，对传入的操作不执行并且返回undefined。void后面可以跟()来用，例如void(0)，看起来是不是很熟悉？没错，在HTML里阻止带href的默认点击操作时，都喜欢把href写成javascript:void(0)，实际上也是依靠void操作不执行的意思。\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">当然，除了出于装逼的原因外，实际用途上不太赞成使用void，因为void的出现是为了兼容早起ECMAScript标准中没有undefined属性。void 0的写法让代码晦涩难懂。\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">10、论如何优雅的取整\r</p><p contenteditable=\"true\">\r</p><p contenteditable=\"true\">var a = ~~2.33var b= 2.33 | 0var c= 2.33 &gt;&gt; 0\r</p><p contenteditable=\"true\">28个超厉害的JavaScript技术用法</p>','2018-03-24 12:50:03','admin','001','10014','2018-03-24 12:50:03',NULL,'I','1'),(16,'aaaaa','<p contenteditable=\"true\"><img src=\"data:image/jpeg;base64,\" data-editor-img=\"img-1521895020305.5254\"><br></p>','2018-03-24 20:37:04','alex','001','10015','2018-03-24 20:37:04',NULL,'I','1'),(17,'图片试一下','<p contenteditable=\"true\"><img src=\"data:image/jpeg;base64,\" data-editor-img=\"img-1521943683130.633\"><br></p>','2018-03-25 10:08:08','admin','005','10016','2018-03-25 10:08:08',NULL,'I','1'),(18,'子不语怪力乱神','<p contenteditable=\"true\"><img src=\"data:image/jpeg;base64,\" data-editor-img=\"img-1522308149278.3901\"><br></p>','2018-03-29 15:22:30','admin','003','10017','2018-03-29 15:22:30',NULL,'I','1'),(