 \r\n      THEN c.`CREATE_TIME` \r\n      ELSE DATE_SUB(\r\n        #{paramMap.endTime,jdbcType=VARCHAR},INTERVAL -1 DAY)\r\n      END\r\n    ) \r\n    AND c.`NOTE_TITLE` LIKE CONCAT_WS(\'%\',\r\n    #{paramMap.searchText,jdbcType=VARCHAR},\'%\')\r\n    AND c.`NOTE_TYPE` IN (SELECT \r\n      q.type_no \r\n    FROM\r\n      p_note_type q \r\n    WHERE INSTR(\r\n        CONCAT(\r\n          \',\',\r\n          (SELECT PKG_TO_down (\r\n            CASE\r\n              WHEN ISNULL(#{paramMap.noteType,jdbcType=VARCHAR}) || LENGTH(TRIM(#{paramMap.noteType,jdbcType=VARCHAR})) < 1 \r\n              THEN q.`TYPE_NO` \r\n              ELSE #{paramMap.noteType,jdbcType=VARCHAR} \r\n            END\r\n          )\r\n        ),\r\n        \',\'\r\n      ),\r\n      CONCAT(\',\', q.type_no, \',\')) > 0 )\r\n    AND a.`ACCOUNT_NO` = (\r\n      CASE\r\n        WHEN (\r\n          #{paramMap.logAccountNo,jdbcType=VARCHAR} = \'admin\' && (ISNULL(#{paramMap.noteSource,jdbcType=VARCHAR}) || LENGTH(TRIM(#{paramMap.noteSource,jdbcType=VARCHAR})) < 1 )) ||#{paramMap.noteSource,jdbcType=VARCHAR} = \'1\'\r\n          THEN a.`ACCOUNT_NO` \r\n          ELSE #{paramMap.logAccountNo,jdbcType=VARCHAR} \r\n        END\r\n      ) \r\n      ORDER BY c.`CREATE_TIME` DESC LIMIT #{paramMap.startNum,jdbcType=VARCHAR},#{paramMap.pageSize,jdbcType=VARCHAR}\r\n    ) t,\r\n    (SELECT \r\n      COUNT(*) totalNum \r\n    FROM\r\n      p_account a,\r\n      p_user_info b,\r\n      p_note_manage c,\r\n      p_note_type d \r\n    WHERE a.`ACCOUNT_NO` = b.`ACCOUNT_NO` \r\n      AND c.`CREATE_PERSON` = b.`ACCOUNT_NO` \r\n      AND d.`TYPE_NO` = c.`NOTE_TYPE` \r\n      AND c.is_use = \'1\' \r\n      AND c.`CREATE_TIME` BETWEEN (\r\n      CASE\r\n        WHEN ISNULL(\r\n          #{paramMap.startTime,jdbcType=VARCHAR}) || LENGTH(TRIM(#{paramMap.startTime,jdbcType=VARCHAR})) < 1 \r\n          THEN c.`CREATE_TIME` \r\n          ELSE #{paramMap.startTime,jdbcType=VARCHAR}\r\n        END\r\n      ) \r\n      AND (\r\n      CASE\r\n        WHEN ISNULL(#{paramMap.endTime,jdbcType=VARCHAR}) || LENGTH(TRIM(#{paramMap.endTime,jdbcType=VARCHAR})) < 1 \r\n        THEN c.`CREATE_TIME` \r\n        ELSE DATE_SUB(\r\n          #{paramMap.endTime,jdbcType=VARCHAR},INTERVAL -1 DAY)\r\n        END\r\n      ) \r\n      AND c.`NOTE_TITLE` LIKE CONCAT_WS(\'%\',\r\n      #{paramMap.searchText,jdbcType=VARCHAR},\'%\')\r\n      AND c.`NOTE_TYPE` IN (SELECT \r\n      q.type_no \r\n    FROM\r\n      p_note_type q \r\n    WHERE INSTR(\r\n        CONCAT(\r\n          \',\',\r\n          (SELECT PKG_TO_down (\r\n            CASE\r\n              WHEN ISNULL(#{paramMap.noteType,jdbcType=VARCHAR}) || LENGTH(TRIM(#{paramMap.noteType,jdbcType=VARCHAR})) < 1 \r\n              THEN q.`TYPE_NO` \r\n              ELSE #{paramMap.noteType,jdbcType=VARCHAR} \r\n            END\r\n          )\r\n        ),\r\n        \',\'\r\n      ),\r\n      CONCAT(\',\', q.type_no, \',\')) > 0 )\r\n      AND a.`ACCOUNT_NO` = (\r\n        CASE\r\n          WHEN (\r\n            #{paramMap.logAccountNo,jdbcType=VARCHAR} = \'admin\' && (ISNULL(#{paramMap.noteSource,jdbcType=VARCHAR}) || LENGTH(TRIM(#{paramMap.noteSource,jdbcType=VARCHAR})) < 1 )) ||#{paramMap.noteSource,jdbcType=VARCHAR} = \'1\'\r\n            THEN a.`ACCOUNT_NO` \r\n            ELSE #{paramMap.logAccountNo,jdbcType=VARCHAR} \r\n          END\r\n        )\r\n      ) k ',NULL,'SELECT','I','2018-03-23 15:05:36'),(5,'NOTE','NOTE-003','保存笔记信息','INSERT INTO p_note_manage (\r\n  NOTE_TITLE,\r\n  NOTE_CONTAIN,\r\n  CREATE_TIME,\r\n  CREATE_PERSON,\r\n  NOTE_TYPE,\r\n  NOTE_NO\r\n) \r\nVALUES\r\n  (\r\n    #{paramMap.noteTitle,jdbcType=VARCHAR},\r\n    #{paramMap.noteContain,jdbcType=VARCHAR},\r\n    NOW(),\r\n    #{paramMap.logAccountNo,jdbcType=VARCHAR},\r\n    #{paramMap.noteTypeNo,jdbcType=VARCHAR},\r\n    nextval (\'noteNoSeq\')\r\n  )',NULL,'INSERT','I','2018-03-23 15:58:32'),(6,'NOTE','NOTE-004','修改笔记信息','UPDATE \r\n  p_note_manage \r\nSET\r\n  NOTE_TITLE = #{paramMap.noteTitle,jdbcType=VARCHAR},\r\n  NOTE_CONTAIN = #{paramMap.noteContain,jdbcType=VARCHAR},\r\n  UPDATE_TIME = NOW(),\r\n  NOTE_TYPE = #{paramMap.noteTypeNo,jdbcType=VARCHAR},\r\n  data_oper_type = \'U\' \r\nWHERE NOTE_NO = #{paramMap.noteNo,jdbcType=VARCHAR}','noteNo,noteTitle,noteContain,noteTypeNo','SELECT','I','2018-03-23 15:58:35'),(7,'NOTE','NOTE-005','获取日记内容','SELECT note_contain noteContain FROM p_note_manage WHERE note_no = #{paramMap.noteNo,jdbcType=VARCHAR}',NULL,'SELECT','I','2018-03-23 15:58:39'),(8,'NOTE','NOTE-006','删除日记（伪删除）','update p_note_manage set is_use = \'2\' where note_no = #{paramMap.noteNo,jdbcType=VARCHAR}','noteNo','DELETE','I','2018-03-24 20:12:52');

